import React, { Component } from 'react';
import Project from './Project/Project';
import reactImg from "../../component/react3.jpg";
import pythonImg from "../../component/python.jpg";

class Projects extends Component {
    constructor() {
        super();
        this.state = {
            data: [{ 
                technology: pythonImg,
                head: "Facial Recognition",
                description: "Facial Recognition content"
            },
            {
                technology: pythonImg,
                head: "Loan Prediction",
                description: "Loan Prediction content"
            },
            {
                technology: reactImg,
                head: "Burger Builder",
                description: "Burger Builder content"
            }]
        };   
    }   
  
    render() {
        return (
        <div>
            <Project data={this.state.data} />
        </div>
        );
    }
}
export default Projects;
